#include <bits/stdc++.h>

class AVL {
   private:
    struct Node {
        int data_;
        Node* left_;
        Node* right_;
        int height_;
        Node(int data)
            : data_(data), left_(nullptr), right_(nullptr), height_(1) {}
    };

    Node* root_;
    bool is_multiset_;

    int height_(Node* node) {
        if (node == nullptr) {
            return 0;
        }
        return node->height_;
    }

    int balance_(Node* node) {
        if (node == nullptr) {
            return 0;
        }
        return height_(node->left_) - height_(node->right_);
    }

    Node* rotate_left(Node* node) {
        Node* newRoot = node->right_;
        node->right_ = newRoot->left_;
        newRoot->left_ = node;
        node->height_ =
            std::max(height_(node->left_), height_(node->right_)) + 1;
        newRoot->height_ =
            std::max(height_(newRoot->left_), height_(newRoot->right_)) + 1;
        return newRoot;
    }

    Node* rotate_right(Node* node) {
        Node* newRoot = node->left_;
        node->left_ = newRoot->right_;
        newRoot->right_ = node;
        node->height_ =
            std::max(height_(node->left_), height_(node->right_)) + 1;
        newRoot->height_ =
            std::max(height_(newRoot->left_), height_(newRoot->right_)) + 1;
        return newRoot;
    }

    Node* insert(Node* node, int data) {
        if (node == nullptr) {
            return new Node(data);
        }
        if (data < node->data_) {
            node->left_ = insert(node->left_, data);
        } else if (data > node->data_ || is_multiset_) {
            node->right_ = insert(node->right_, data);
        } else {
            return node;
        }
        node->height_ =
            std::max(height_(node->left_), height_(node->right_)) + 1;
        int balanceFactor = balance_(node);
        if (balanceFactor > 1) {
            if (data < node->left_->data_) {
                return rotate_right(node);
            } else {
                node->left_ = rotate_left(node->left_);
                return rotate_right(node);
            }
        }
        if (balanceFactor < -1) {
            if (data > node->right_->data_) {
                return rotate_left(node);
            } else {
                node->right_ = rotate_right(node->right_);
                return rotate_left(node);
            }
        }
        return node;
    }

    Node* remove(Node* node, int data) {
        if (node == nullptr) {
            return node;
        }
        if (data < node->data_) {
            node->left_ = remove(node->left_, data);
        } else if (data > node->data_) {
            node->right_ = remove(node->right_, data);
        } else {
            if (node->left_ == nullptr) {
                Node* temp = node;
                node = node->right_;
                delete temp;
                return node;
            } else if (node->right_ == nullptr) {
                Node* temp = node;
                node = node->left_;
                delete temp;
                return node;
            }
            Node* temp = minimum(node->right_);
            node->data_ = temp->data_;
            node->right_ = remove(node->right_, temp->data_);
        }
        if (node == nullptr) {
            return node;
        }
        node->height_ =
            std::max(height_(node->left_), height_(node->right_)) + 1;
        int balanceFactor = balance_(node);
        if (balanceFactor > 1) {
            if (balance_(node->left_) >= 0) {
                return rotate_right(node);
            } else {
                node->left_ = rotate_left(node->left_);
                return rotate_right(node);
            }
        }
        if (balanceFactor < -1) {
            if (balance_(node->right_) <= 0) {
                return rotate_left(node);
            } else {
                node->right_ = rotate_right(node->right_);
                return rotate_left(node);
            }
        }
        return node;
    }

    Node* minimum(Node* node) {
        if (node == nullptr || node->left_ == nullptr) {
            return node;
        }
        return minimum(node->left_);
    }

    Node* find(Node* node, int data) {
        if (node == nullptr || node->data_ == data) {
            return node;
        }
        if (data < node->data_) {
            return find(node->left_, data);
        }
        return find(node->right_, data);
    }

    void inorder(Node* node, std::vector<int>& result) {
        if (node == nullptr) {
            return;
        }
        inorder(node->left_, result);
        result.push_back(node->data_);
        inorder(node->right_, result);
    }

   public:
    AVL(bool is_multiset = false) : root_(nullptr), is_multiset_(is_multiset) {}

    void insert(int data) { root_ = insert(root_, data); }

    void remove(int data) { root_ = remove(root_, data); }

    Node* find(int data) { return find(root_, data); }

    std::vector<int> inorder() {
        std::vector<int> result;
        inorder(root_, result);
        return result;
    }
};

public class LogicCalculator : Form
{
    private TextBox display;
    private Button[] buttons;
    private string operand1 = "";
    private string operand2 = "";
    private string operation = "";
    private bool operationCompleted = false;

    public LogicCalculator()
    {
        display = new TextBox { Top = 10, Left = 10, Width = 200, ReadOnly = true };
        buttons = new Button[8];
        string[] labels = { "0", "1", "AND", "OR", "NOT", "XOR", "IMPLIES", "EQUIVALENT" };

        Size = new Size(250, 200);
        FormBorderStyle = FormBorderStyle.FixedSingle;
        MaximizeBox = false;

        for (int i = 0; i < 8; i++)
        {
            buttons[i] = new Button
            {
                Text = labels[i],
                Top = 50 + (i / 2) * 30,
                Left = 10 + (i % 2) * 60,
                Width = 50
            };
            buttons[i].Click += new EventHandler(Button_Click);
            Controls.Add(buttons[i]);
        }

        Controls.Add(display);
    }

    private void Button_Click(object sender, EventArgs e)
    {
        Button button = (Button)sender;
        string buttonText = button.Text;

        if (operationCompleted && (buttonText == "0" || buttonText == "1"))
        {
            operand1 = "";
            operand2 = "";
            operation = "";
            operationCompleted = false;
            buttons[0].Enabled = true; // Enable button "0"
            buttons[1].Enabled = true; // Enable button "1"
        }

        if (buttonText == "0" || buttonText == "1")
        {
            if (operation == "" && operand1 == "")
            {
                operand1 = buttonText;
                display.Text = operand1;
                buttons[0].Enabled = false; // Disable button "0"
                buttons[1].Enabled = false; // Disable button "1"
            }
            else if (operation != "" && operand2 == "")
            {
                operand2 = buttonText;
                display.Text = operand1 + " " + operation + " " + operand2;
            }
        }
        else if (buttonText == "AND" || buttonText == "OR" || buttonText == "XOR" || buttonText == "IMPLIES" || buttonText == "EQUIVALENT")
        {
            if (operand1 != "" && operation == "")
            {
                operation = buttonText;
                display.Text = operand1 + " " + operation;
                buttons[0].Enabled = true; // Enable button "0"
                buttons[1].Enabled = true; // Enable button "1"
            }
        }
        else if (buttonText == "NOT")
        {
            if (operand1 != "")
            {
                Convert(ref operand1, out bool a);
                operand1 = (!a).ToString();
                display.Text = operand1;
                operationCompleted = true;
                buttons[0].Enabled = true; // Enable button "0"
                buttons[1].Enabled = true; // Enable button "1"
            }
        }

        if (operand1 != "" && operand2 != "" && operation != "")
        {
            Convert(ref operand1, out bool a);
            Convert(ref operand2, out bool b);
            bool result = false;

            switch (operation)
            {
                case "AND":
                    result = a && b;
                    break;
                case "OR":
                    result = a || b;
                    break;
                case "XOR":
                    result = a ^ b;
                    break;
                case "IMPLIES":
                    result = !a || b;
                    break;
                case "EQUIVALENT":
                    result = a == b;
                    break;
            }

            display.Text = operand1 + " " + operation + " " + operand2 + " = " + result.ToString();

            operand1 = result.ToString();
            operand2 = "";
            operation = "";
            operationCompleted = true;
        }
    }

    public static void Convert(ref string str, out bool a)
    {
        a = str.Equals("1");
    }

    [STAThread]
    static void Main()
    {
        Application.Run(new LogicCalculator());
    }
}

