def day10(s, *, part2=False):
  grid = np.array([list(line) for line in s.splitlines()])
  (yx_start,) = np.argwhere(grid == 'S')
  loop = [tuple(yx_start)]
  dy, dx = 1, 0
  yx = tuple(yx_start + (dy, dx))
  assert grid[yx] in '|LJ', 'Start went downwards in all examples I saw.'
  while (ch := grid[yx]) != 'S':
    loop.append(yx)
    dy, dx = (dx, dy) if ch in 'L7' else (-dx, -dy) if ch in 'JF' else (dy, dx)
    yx = yx[0] + dy, yx[1] + dx

  if not part2:
    return len(loop) // 2

  grid2 = np.full(np.array(grid.shape) * 2 + 1, 0)
  for (y0, x0), (y1, x1) in itertools.pairwise(loop + [loop[0]]):
    grid2[y0 * 2 + 1, x0 * 2 + 1] = grid2[y0 + y1 + 1, x0 + x1 + 1] = 1

  for offset in itertools.product([-1, 1], repeat=2):
    seed_point = tuple(yx_start * 2 + 1 + offset)
    grid3 = skimage.segmentation.flood_fill(grid2, seed_point, 2)
    if grid3[0, 0] != 2:
      return np.count_nonzero(grid3[1::2, 1::2] == 2)

