using namespace std;

class AVLTree {
private:
    struct AVLNode {
        int key_ = 0;
        int height_ = 1;
        AVLNode* left_ = nullptr;
        AVLNode* right_ = nullptr;
        AVLNode(int key) : key_(key) {}
    };

    AVLNode* root_ = nullptr;
    const int OFFSET_STEP = 4;

    AVLNode* RightRotation(AVLNode* parent) {
        AVLNode* new_parent = parent->left_;
        parent->left_ = new_parent->right_;
        new_parent->right_ = parent;

        parent->height_ = max(GetHeight(parent->left_), GetHeight(parent->right_)) + 1;
        new_parent->height_ = max(GetHeight(new_parent->left_), GetHeight(new_parent->right_)) + 1;

        return new_parent;
    }

    AVLNode* LeftRotation(AVLNode* parent) {
        AVLNode* new_parent = parent->right_;
        parent->right_ = new_parent->left_;
        new_parent->left_ = parent;

        parent->height_ = max(GetHeight(parent->left_), GetHeight(parent->right_)) + 1;
        new_parent->height_ = max(GetHeight(new_parent->left_), GetHeight(new_parent->right_)) + 1;

        return new_parent;
    }
    
    AVLNode* Insert_(AVLNode* node, int key) {
        if (node == nullptr) { return node = new AVLNode(key); }

        if (key < node->key_) {
            node->left_ = Insert_(node->left_, key);
        }
        else if (key > node->key_) {
            node->right_ = Insert_(node->right_, key);
        }
        else /*if (node->key_ == key)*/ return node;

        node->height_ = max(GetHeight(node->left_), GetHeight(node->right_)) + 1;

        int balance = GetBalance(node);

        if (balance < -1 && key > node->right_->key_) return LeftRotation(node);
        if (balance < -1 && key < node->right_->key_) {
            node->right_ = RightRotation(node->right_);
            return LeftRotation(node);
        }
        if (balance > 1 && key < node->left_->key_) return RightRotation(node);
        if (balance > 1 && key > node->left_->key_) {
            node->left_ = LeftRotation(node->left_);
            return RightRotation(node);
        }

        return node;
    }

    int GetBalance(AVLNode* node) {
        if (node == nullptr) return 0;
        return GetHeight(node->left_) - GetHeight(node->right_);
    }

    int GetHeight(AVLNode* node) {
        if (node == nullptr) return 0;
        return node->height_;
    }

    AVLNode* Pop_(AVLNode* node, int key) {
        if (node == nullptr) return nullptr;

        if (key < node->key_) {
            node->left_ = Pop_(node->left_, key);
        }
        else if (key > node->key_) {
            node->right_ = Pop_(node->right_, key);
        }
        else /*if (node->key_ == key)*/ {
            if (node->left_ == nullptr && node->right_ == nullptr) {
                delete node;
                return nullptr;
            }
            else if (node->left_ == nullptr && node->right_ != nullptr)
            {
                AVLNode* right_subtree = node->right_;
                delete node;
                return right_subtree;
            }
            else if (node->left_ != nullptr && node->right_ == nullptr)
            {
                AVLNode* left_subtree = node->left_;
                delete node;
                return left_subtree;
            } 
            else {
                //AVLNode* right_subtree_min = GetMin(node->right_);
                AVLNode* left_subtree_max = GetMax(node->left_);
                //if (abs(node->key_ - left_subtree_max->key_) < abs(right_subtree_min->key_ - node->key_)) {
                    node->key_ = left_subtree_max->key_;
                    node->left_ = Pop_(node->left_, left_subtree_max->key_);
                //} else {
                //    node->key_ = right_subtree_min->key_;
                //    node->right_ = Pop_(node->right_, right_subtree_min->key_);
                //}
            }
        }

        node->height_ = max(GetHeight(node->left_), GetHeight(node->right_)) + 1;

        int balance = GetBalance(node);

        if (balance < -1 && GetBalance(node->right_) <= 0) return LeftRotation(node);
        if (balance < -1 && GetBalance(node->right_) > 0) {
            node->right_ = RightRotation(node->right_);
            return LeftRotation(node);
        }
        if (balance > 1 && GetBalance(node->left_) >= 0) return RightRotation(node);
        if (balance > 1 && GetBalance(node->left_) < 0) {
            node->left_ = LeftRotation(node->left_);
            return RightRotation(node);
        }

        return node;
    }

    AVLNode* GetMax(AVLNode* node) {
        if (!node->right_) return node;
        return GetMax(node->right_);
    }
    
    AVLNode* GetMin(AVLNode* node) {
        if (!node->left_) return node;
        return GetMin(node->left_);
    }
    
    void Print_(AVLNode* node, int offset = 0) const {
        if (node == nullptr) return;

        Print_(node->left_, offset + OFFSET_STEP);
        cout << setw(offset) << node->key_ << '\n';
        Print_(node->right_, offset + OFFSET_STEP);
    }

    class InorderIterator {
    private:
        stack<AVLNode*> traversal;

    public:
        InorderIterator(AVLNode* root) {
            moveLeft(root);
        }

        void moveLeft(AVLNode* current) {
            while (current) {
                traversal.push(current);
                current = current->left_;
            }
        }

        bool hasNext() {
            return !traversal.empty();
        }

        AVLNode* next() {
            if (!hasNext())
                throw "No such element Exists";

            AVLNode* current = traversal.top();
            traversal.pop();

            if (current->right_) moveLeft(current->right_);

            return current;
        }
    };

public:

    AVLTree() {}

    ~AVLTree() {}

    void Insert(int key) { root_ = Insert_(root_, key); }

    void Pop(int key) { root_ = Pop_(root_, key); }

    void Print() const {
        cout << '\n';
        Print_(root_);
        cout << '\n';
    }
};

int main() {
    AVLTree avl_tree;
   
    for (int i = 0; i < 10; ++i) {
        avl_tree.Insert(i);
        avl_tree.Print();
    }

    for (int i = 0; i < 10; ++i) {
        avl_tree.Pop(i);
        avl_tree.Print();
    }

    return 0;
}

