    glMaterialfv(GL_FRONT_AND_BACK, GL_SHININESS, shininess);

    glEnable(GL_COLOR_MATERIAL);
    glColorMaterial(GL_FRONT_AND_BACK, GL_AMBIENT_AND_DIFFUSE);
    glColor3f(1, 0, 0); // Tetapkan warna objek

    // HURUF I (contoh)
    glBegin(GL_QUADS);
    // Tiang Bagian 1
    frontAndRear_quads(front.tiang.part1);

    frontAndRear_quads(rear.tiang.part1);

    sidesDrawer(4, front.tiang.part1, rear.tiang.part1);
    glEnd();

    glColor3f(0, 1, 0); // Tetapkan warna objek
    glBegin(GL_QUADS);
    // Tiang Bagian 2
    frontAndRear_quads(front.tiang.part2);

    frontAndRear_quads(rear.tiang.part2);

    sidesDrawer(4, front.tiang.part2, rear.tiang.part2);
    glEnd();

    glColor3f(0, 0, 1); // Tetapkan warna objek
    glBegin(GL_QUADS);
    // Tiang Bagian 3
    frontAndRear_quads(front.tiang.part3);

    frontAndRear_quads(rear.tiang.part3);

    sidesDrawer(4, front.tiang.part3, rear.tiang.part3);
    glEnd();

}

void display()
{
    glClear(GL_COLOR_BUFFER_BIT | GL_DEPTH_BUFFER_BIT);
    glClearColor(1.0, 1.0, 1.0, 1.0); // rgb(255, 255, 255)
    TiangBendera();
    glutSwapBuffers();
    glutPostRedisplay();
}

void init()
{
    // pencahayaan
    glEnable(GL_LIGHTING);
    glEnable(GL_LIGHT0); // Konfigurasi Cahaya ke-1
    glLightfv(GL_LIGHT0, GL_DIFFUSE, light_diffuse1);
    glLightfv(GL_LIGHT0, GL_POSITION, light_position);
    // glEnable(GL_LIGHT1); // Konfigurasi Cahaya ke-2
    // glLightfv(GL_LIGHT1, GL_DIFFUSE, light_diffuse2);
    // glLightfv(GL_LIGHT1, GL_POSITION, light_position2);
    // Buffer
    glEnable(GL_DEPTH_TEST);
    // setup projection
    glMatrixMode(GL_PROJECTION);
    glLoadIdentity();
    gluPerspective(45.0, 1.0, 1.0, 100.0); // sudut pandang vertikal, lebar/tinggi layar, jarak terdepan kamera, jarak terjauh kamera

    glMatrixMode(GL_MODELVIEW);
    glLoadIdentity();
    gluLookAt(0.0, 20.0, -40.0, // eyeX, eyeY, eyeZ (Posisi Kamera)
              0.0, 5.0, 0.0,    // centerX, centerY, CenterZ (Titik Pusat Yang Dilihat Kamera)
              0.0, 2.0, 0.0);   // Vektor Atas
}

int main(int argc, char **argv)
{
    glutInit(&argc, argv);
    glutInitDisplayMode(GLUT_DOUBLE | GLUT_RGB | GLUT_DEPTH);
    glutInitWindowSize(700, 350);
    glutCreateWindow("TBTBTBTB");
    glutDisplayFunc(display);
    init();
    glutMainLoop();
    return 0;
}
